import React, { useState, useEffect } from 'react';
import axios from 'axios';
import jwt_decode from "jwt-decode"
import { useCookies } from 'react-cookie';
import Cookies from 'js-cookie';
import { useNavigate } from 'react-router-dom';

function Account() {

    const [cookies,setCookies] = useCookies()
    const navigate = useNavigate()

    const cookieDetails = Cookies.get('Cookie')

    // if(cookieDetails.token) {

    // }
    const parsedCookie = JSON.parse(cookieDetails)
    console.log('Cookieeeee' , parsedCookie.token)
    const decodedToken = jwt_decode(parsedCookie.token)
    console.log("Decoded Token", decodedToken.email)


    function handleLogout() {
        if(cookieDetails) {
            setCookies('Cookie' , '')

            return
        }
       navigate("/")
    }

    return(
        <div>
            <h1>Account</h1>
            <input type='file' />
            <button>Upload</button>
            <button onClick={handleLogout}>Logout</button>
        </div>

    )
}

export default Account
